import React from 'react';
import './App.css';

import LinkNavigation from "./components/atoms/LinkNatigation"

function App() {
  const showPath = () => {
    console.log(__dirname)
  }

  return (
    <div className="App">
      <nav>
        <img src="../src/components/logo192.png" alt="test" />
        <LinkNavigation link="#" text="Test" />
        {showPath()}
      </nav>
    </div>
  );
}

export default App;
